	const urlAvailability = `https://api.data.gov.sg/v1/transport/carpark-availability`;

	useEffect(() => {
		axios.get(urlLocation).then((res) => {
			setQueryCpObj({ ...queryCpObj, location: res.data.result.records });

			axios.get(urlAvailability).then((res) => {
