	};

	return (
		<div className="App">
			<header>
				<nav>
					<ul>
						<li>Home</li>
						<li>About</li>
						<li>Contact</li>
					</ul>
				</nav>
			</header>

			<main>
				<form onSubmit={handleSubmit}>
					<input type="text" name="query" />
					<input type="submit" />
				</form>
				<section></section>
				<article>
					<div>Traffic Cam</div>
					<div>ERP rates</div>
